import React from 'react';

const CardItemContent = ({ cartItem }) => (
  <ul>
    <li>
      Name :
      {cartItem.name}
    </li>
    <li>
      Rating:
      <span role="img" aria-label="Stars">⭐️⭐️⭐️⭐️⭐️</span>
    </li>
    <li>
      Origin:
      {cartItem.origin}
    </li>
    <li>PriceEN : {cartItem.priceUSD}</li>
  </ul>
);

export default CardItemContent;
